            listItems.push(<li key={key}>{key}: {eMap[key]} mins</li>)
        }



        console.log(listItems)

        return <ul>{listItems}</ul>;
    }

    return (
        <div>
            <h2>Data Aggregation</h2>
            {displayAggregations()}
        </div>
    );
}

